// Navbar.jsx

import React from "react";

const NavBar = () => {
  return (
    <div className="flex justify-between items-center bg-orange-500 text-white p-4">
      {/* Left side: Logo */}
      <div className="logo w-40">
        <img src="Quill.png" alt="Logo" className="max-w-16" />
      </div>

      {/* Center: Links to Different Pages */}
      <div className="flex gap-4">
        <a href="/" className="text-black hover:text-orange-200">
          Home
        </a>
        <a href="/about" className="text-black hover:text-gray-300">
          About
        </a>
        <a href="/services" className="text-black hover:text-gray-300">
          Services
        </a>
        <a href="/contact" className="text-black hover:text-gray-300">
          Contact
        </a>
      </div>

      {/* Right side: Search Bar */}
      <div className="flex gap-4">
        <input
          type="text"
          placeholder="Search"
          className="px-4  rounded-full"
        />
        <button type="button" className="p-2 bg-black text-white rounded">
          Search
        </button>
      </div>
    </div>
  );
};

export default NavBar;
